import React from 'react';
import Introduction from '../components/Introduction';
import ServiceCard from '../components/ServiceCard';
import HighlightedProduct from '../components/HighlightedProduct';
import ClientTestimonial from '../components/ClientTestimonial';
import ContactInformation from '../components/ContactInformation';

function ServicePage() {
  return (
    <div className="service-page p-4">
      <Introduction />
      <div className="service-cards grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 mt-4">
        <ServiceCard name="Service 1" description="Description for Service 1" image="data analytics.jpeg" />
        <ServiceCard name="Service 2" description="Description for Service 2" image="path/to/image2.jpg" />
        <ServiceCard name="Service 3" description="Description for Service 3" image="path/to/image3.jpg" />
      </div>
      <h2 className="text-3xl font-bold mt-8">Highlighted Products</h2>
      <div className="highlighted-products grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 mt-4">
        <HighlightedProduct name="Product 1" description="Description for Product 1" image="path/to/product1.jpg" />
        <HighlightedProduct name="Product 2" description="Description for Product 2" image="path/to/product2.jpg" />
      </div>
      <h2 className="text-3xl font-bold mt-8">Client Testimonials</h2>
      <div className="client-testimonials grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 mt-4">
        <ClientTestimonial quote="Great service!" client="Client A" />
        <ClientTestimonial quote="Excellent products!" client="Client B" />
      </div>
      <ContactInformation />
    </div>
  );
}

export default ServicePage;
